import React from 'react';
import '../../Header.css';
import bars from '../../../../img/bars-solid.svg';

class Menu extends React.Component{
    render(){
        return  <div className="navbar">
                    <button handleClick={this.handleClick}><img src={bars} alt="fa-bars" /></button>
                </div>  
    } 
}

export default Menu;
